<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyCodeVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyApiKeyVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyEnabledVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyScopesVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartySchemasVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyPoliciesVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\ValueObject\RelyingPartyVersionVO;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\RelyingPartyAttributes;
use PHPUnit\Framework\TestCase;

final class RelyingPartyAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new RelyingPartyAttributes();
        $codeOneValue = 'one';
        $codeOtherValue = 'other';
        $copy = $value->code($codeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getCode());
        $this->assertNotEquals('other', $value->getCode());
        $this->assertEquals('one', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('other', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $value->unsetCode();
        $this->assertEquals('other', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('one', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $apiKeyOneValue = 'one';
        $apiKeyOtherValue = 'other';
        $copy = $value->apiKey($apiKeyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getApiKey());
        $this->assertNotEquals('other', $value->getApiKey());
        $this->assertEquals('one', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $this->assertNotEquals('other', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $value->unsetApiKey();
        $this->assertEquals('other', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $this->assertNotEquals('one', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isEnabled());
        $this->assertNotEquals(false, $value->isEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $scopesOneValue = 'one';
        $scopesOtherValue = 'other';
        $copy = $value->scopes($scopesOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getScopes());
        $this->assertNotEquals('other', $value->getScopes());
        $this->assertEquals('one', $value->getScopesOrDefault(RelyingPartyScopesVO::from($scopesOtherValue))->value());
        $this->assertNotEquals('other', $value->getScopesOrDefault(RelyingPartyScopesVO::from($scopesOtherValue))->value());
        $value->unsetScopes();
        $this->assertEquals('other', $value->getScopesOrDefault(RelyingPartyScopesVO::from($scopesOtherValue))->value());
        $this->assertNotEquals('one', $value->getScopesOrDefault(RelyingPartyScopesVO::from($scopesOtherValue))->value());
        $schemasOneValue = 'one';
        $schemasOtherValue = 'other';
        $copy = $value->schemas($schemasOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getSchemas());
        $this->assertNotEquals('other', $value->getSchemas());
        $this->assertEquals('one', $value->getSchemasOrDefault(RelyingPartySchemasVO::from($schemasOtherValue))->value());
        $this->assertNotEquals('other', $value->getSchemasOrDefault(RelyingPartySchemasVO::from($schemasOtherValue))->value());
        $value->unsetSchemas();
        $this->assertEquals('other', $value->getSchemasOrDefault(RelyingPartySchemasVO::from($schemasOtherValue))->value());
        $this->assertNotEquals('one', $value->getSchemasOrDefault(RelyingPartySchemasVO::from($schemasOtherValue))->value());
        $policiesOneValue = 'one';
        $policiesOtherValue = 'other';
        $copy = $value->policies($policiesOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getPolicies());
        $this->assertNotEquals('other', $value->getPolicies());
        $this->assertEquals('one', $value->getPoliciesOrDefault(RelyingPartyPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('other', $value->getPoliciesOrDefault(RelyingPartyPoliciesVO::from($policiesOtherValue))->value());
        $value->unsetPolicies();
        $this->assertEquals('other', $value->getPoliciesOrDefault(RelyingPartyPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('one', $value->getPoliciesOrDefault(RelyingPartyPoliciesVO::from($policiesOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
